DROP TABLE IF EXISTS `bsp_rule_info`;
CREATE TABLE `bsp_rule_info`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `tenant_id` varchar(4) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '租户',
  `config_name` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '配置名称',
  `field_key` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '字段key',
  `web_field_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '前端字段名',
  `state` tinyint(2) NOT NULL DEFAULT 0 COMMENT '是否生效：0-否；1-是',
  `remark` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注',
  `order_channel` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '下单渠道：1-WEB单票；2-WEB导入；3-jvgo；4-api单个；5-api批量，多个逗号分隔',
  `rule_type` int(4) DEFAULT NULL COMMENT '规则类型 1 基础 2 组合 3 特殊',
  `config_key` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '特殊配置key值',
  `rule_condition` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '规则条件',
  `rule_condition_backstage` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '基础规则对应joiner的json形式',
  `pre_condition` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '前置条件',
  `pre_condition_md5` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '前置条件MD5值',
  `month_card_no_white` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '月结卡号白名单，逗号分隔',
  `from_template` tinyint(2) DEFAULT 0 COMMENT '是否来自模板规则 0:不是 1:是',
  `rule_template` tinyint(2) DEFAULT 0 COMMENT '模板规则,0不是, 1是模板',
  `web_display_order` bigint(4) DEFAULT NULL COMMENT '前端控件排序',
  `web_display` tinyint(2) NOT NULL DEFAULT 1 COMMENT '前端是否展示控件：0-不展示；1-展示',
  `create_by` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '创建人',
  `modified_by` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '修改人',
  `gmt_create` bigint(16) DEFAULT NULL COMMENT '创建时间',
  `gmt_modified` bigint(16) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_config_name`(`config_name`) USING BTREE,
  INDEX `idx_rule_type`(`rule_type`) USING BTREE,
  INDEX `idx_field_key`(`field_key`) USING BTREE,
  INDEX `idx_gmt_create`(`gmt_create`) USING BTREE,
  INDEX `idx_tenant`(`tenant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 875 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '字段规则配置' ROW_FORMAT = Dynamic;

